Event API for screen width changes.

This API is based on media queries but can also be used if media queries are not natively supported by the used browser. In this case, the behavior of media queries is simulated by this API.

There are several predefined {@link sap.ui.Device.media.RANGESETS range sets} available. Each of them defines a set of intervals for the screen width (from small to large). Whenever the screen width changes and the current screen width is in a different interval to the one before the change, the registered event handlers for the range set are called.

If needed, it is also possible to define a custom set of intervals.

The following example shows a typical use case: <pre>
function sizeChanged(mParams) {
    switch(mParams.name) {
        case "Phone":
            // Do what is needed for a little screen
            break;
        case "Tablet":
            // Do what is needed for a medium sized screen
            break;
        case "Desktop":
            // Do what is needed for a large screen
    }
}

// Register an event handler to changes of the screen size
sap.ui.Device.media.attachHandler(sizeChanged, null, sap.ui.Device.media.RANGESETS.SAP_STANDARD);
// Do some initialization work based on the current size
sizeChanged(sap.ui.Device.media.getCurrentRange(sap.ui.Device.media.RANGESETS.SAP_STANDARD));
</pre>

extend.!description:
Defines a new subclass of Control with the name <code>sClassName</code> and enriches it with the information contained in <code>oClassInfo</code>.

<code>oClassInfo</code> can contain the same information that {@link sap.ui.core.Element.extend} already accepts, plus the following <code>renderer</code> property:

Example: <pre>
Control.extend("sap.mylib.MyControl", {
  metadata : {
    library : "sap.mylib",
    properties : {
      text : "string",
      width : "sap.ui.core.CSSSize"
    }
  },
  renderer: {
    apiVersion: 2,
    render: function(oRM, oControl) {
      oRM.openStart("div", oControl);
      oRM.style("width", oControl.getWidth());
      oRM.openEnd();
      oRM.text(oControl.getText());
      oRM.close("div");
    }
  }
});
</pre>

There are multiple ways how a renderer can be specified: <ul> <li>As a <b>plain object</b>: The object will be used to create a new renderer by using {@link sap.ui.core.Renderer.extend} to extend the renderer of the base class of this control. The new renderer will have the same global name as this control class with the additional suffix 'Renderer'.<br> <b>Note:</b> The <code>Renderer.extend</code> method expects a plain object (no prototype chain).</li> <li>As a <b>function</b>: The given function will be used as <code>render</code> function of a new renderer; the renderer will be created in the same way as described for the <i>plain object</i> case.</li> <li>As a <b>ready-made renderer</b>, e.g. imported from the corresponding renderer module. As renderers are simple objects (not instances of a specific class), some heuristic is used to distinguish renderers from the <i>plain object</i> case above: An object is assumed to be a ready-made renderer when it has a <code>render</code> function and either is already exposed under the expected global name or has an <code>extend</code> method.</li> <li>As a <b>fully qualified name</b>: The name will be looked up as a global property. If not defined, a module name will be derived from the global name (dots replaced by slashes), the module will be required and provides the renderer, either as AMD export or via the named global property.</li> <li><b>Omitting the <code>renderer</code> property</b> or setting it to <code>undefined</code>: The fully qualified name of the renderer will be derived from the fully qualified name of the control by adding the suffix "Renderer". The renderer then is retrieved in the same way as described for the <i>fully qualified name</i> case.</li> <li><b><code>null</code> or empty string</b>: The control will have no renderer, a call to <code>oControl.getMetadata().getRenderer()</code> will return <code>undefined</code>.</li> </ul>

If the resulting renderer is incomplete (has no <code>render</code> function) or if it cannot be found at all, rendering of the control will be skipped.

<b>Note:</b> The <code>apiVersion: 2</code> flag is required to enable in-place rendering technology. Before setting this property, please ensure that the constraints documented in section "Contract for Renderer.apiVersion 2" of the {@link sap.ui.core.RenderManager RenderManager} API documentation are fulfilled.

sap.ui.test.matchers.I18NText.!description:
The I18NText matcher checks if a control property has the same value as a text from an I18N file.

The matcher automatically: <ul> <li> retrieves the text from the assigned 'i18n' model (name can be changed) </li> <li> checks that the I18N key does actually exist in the file </li> <li> checks if asynchronously loaded I18N have actually been loaded </li> </ul>

As of version 1.72, it is available as a declarative matcher with the following syntax: <code><pre>{
    i18NText: {
        propertyName: "string",
        key: "string",
        parameters: "any",
        modelName: "string"
    }
}
</code></pre>

sap.ui.test.matchers.I18NText.!helpDescription:
The I18NText matcher checks if a control property has the same value as a text from an I18N file.

The matcher automatically: <ul> <li> retrieves the text from the assigned 'i18n' model (name can be changed) </li> <li> checks that the I18N key does actually exist in the file </li> <li> checks if asynchronously loaded I18N have actually been loaded </li> </ul>

As of version 1.72, it is available as a declarative matcher with the following syntax: <code><pre>{
    i18NText: {
        propertyName: "string",
        key: "string",
        parameters: "any",
        modelName: "string"
    }
}
</code></pre>

sap.ui.model.CompositeDataState.!description:
Provides and update the status data of a binding. Depending on the models state and controls state changes, the data state is used to propagated changes to a control. The control can react on these changes by implementing the <code>refreshDataState</code> method for the control. Here the data state object is passed as a parameter.

Using the {@link #getChanges getChanges} method the control can determine the changed properties and their old and new value. <pre>
    //sample implementation to handle message changes
    myControl.prototype.refreshDataState = function(oDataState) {
       var aMessages = oDataState.getChanges().messages;
       if (aMessages) {
           for (var i = 0; i &lt; aMessages.length; i++) {
               console.log(aMessages.message);
           }
       }
    }

    //sample implementation to handle laundering state
    myControl.prototype.refreshDataState = function(oDataState) {
       var bLaundering = oDataState.getChanges().laundering || false;
       this.setBusy(bLaundering);
    }

    //sample implementation to handle dirty state
    myControl.prototype.refreshDataState = function(oDataState) {
       if (oDataState.isDirty()) console.log("Control " + this.getId() + " is now dirty");
    }
</pre>

Using the {@link #getProperty getProperty} method the control can read the properties of the data state. The properties are <ul> <li><code>value</code> The value formatted by the formatter of the binding <li><code>originalValue</code> The original value of the model formatted by the formatter of the binding <li><code>invalidValue</code> The control value that was tried to be applied to the model but was rejected by a type validation <li><code>modelMessages</code> The messages that were applied to the binding by the <code>sap.ui.model.MessageModel</code> <li><code>controlMessages</code> The messages that were applied due to type validation errors <li><code>messages</code> All messages of the data state <li><code>dirty</code> true if the value was not yet confirmed by the server </ul>

