extend.!description:
Creates a new renderer that extends a given renderer.

This method can be used with two signatures that are explained below. In both variants, the returned renderer inherits all properties (methods, fields) from the given parent renderer. Both variants also add an 'extend' method to the created renderer that behaves like the modern signature variant of this <code>Renderer.extend</code> method, but allows to extend the new renderer instead of <code>sap.ui.core.Renderer</code>.

<h3>Modern Signature</h3>

In the modern signature variant, two parameters must be given: a qualified name for the new renderer (its global name, in dot-notation), and an optional object literal that contains methods or fields to be added to the new renderer class.

This signature has been designed to resemble the class extension mechanism as provided by {@link sap.ui.base.Object.extend Object.extend}.

<pre>
sap.ui.define(['sap/ui/core/Renderer'],
    function(Renderer) {
    "use strict";

    var LabelRenderer = Renderer.extend('sap.m.LabelRenderer', {
        render: function(oRM, oControl) {

            renderPreamble(oRM, oControl);

            // implementation core renderer logic here

            renderPostamble(oRM, oControl);

        },

        renderPreamble : function(oRM, oControl) {
        ...
        },

        renderPostamble : function(oRM, oControl) {
        ...
        }

    });

    return LabelRenderer;
});
</pre>

The extension of renderers works across multiple levels. A <code>FancyLabelRenderer</code> can extend the above <code>LabelRenderer</code>:

<pre>
sap.ui.define(['sap/m/LabelRenderer'],
    function(LabelRenderer) {
    "use strict";

    var FancyLabelRenderer = LabelRenderer.extend('sap.mylib.FancyLabelRenderer', {
        render: function(oRM, oControl) {

            // call base renderer
            LabelRenderer.renderPreamble(oRM, oControl);

            // ... do your own fancy rendering here

            // call base renderer again
            LabelRenderer.renderPostamble(oRM, oControl);
        }
    });

    return FancyLabelRenderer;
});
</pre>

<b>Note:</b> The modern signature no longer requires the <code>bExport</code> flag to be set for the enclosing {@link sap.ui.define} call. The Renderer base class takes care of the necessary global export of the renderer. This allows non-SAP developers to write a renderer that complies with the documented restriction for <code>sap.ui.define</code> (no use of bExport = true outside sap.ui.core projects).

<h3>Deprecated Signature</h3>

The deprecated old signature expects just one parameter: a renderer that should be extended. With that signature, the renderer can't be exported globally as the name of the renderer class is not known.

For compatibility reasons, the class created by the deprecated signature contains a property <code>_super</code> that references the parent class. It shouldn't be used by applications / control developers as it doesn't work reliably for deeper inheritance chains: if the old variant of <code>Renderer.extend</code> is used on two or more levels of the inheritance hierarchy, the <code>_super</code> property of the resulting renderer class will always point to the implementation of the base renderer of the last call to extend. Instead of using <code>this._super</code>, renderer implementations should use the new signature variant and access the base implementation of a method via the AMD reference to the base renderer (as shown in the FancyLabelRenderer example above).

<h3>Use as a Generic Method</h3>

Only renderers that have been created with a call to <code>extend</code> will get their own <code>extend</code> method to create new subclasses. To allow extending from older renderers that have been written from scratch as a plain object, the <code>Renderer.extend</code> method can be called as a <i>generic method</i>, providing the base renderer as <code>this</code>.

Example: Derive from <code>HBoxRenderer</code> (which is assumed to be a plain object) <pre>
sap.ui.define(['sap/ui/core/Renderer', 'sap/m/HBoxRenderer'],
    function(Renderer, HBoxRenderer) {
    "use strict";

    // Call 'extend' as a generic method, providing the HBoxRenderer as 'this'
    var MyRenderer = Renderer.extend.call(HBoxRenderer, 'sap.m.LabelRenderer', {

        someOverriddenHook: function(oRM, oControl) {
        ...
        },

    });

    return LabelRenderer;
});
</pre>

<b>Note:</b> The deprecated signature cannot be used generically, it is only supported when called on <code>sap.ui.core.Renderer</code>.

sap.ui.core.util.XMLPreprocessor.IContex.!description:
Context interface provided by XML template processing as an additional first argument to any formatter function which opts in to this mechanism. Candidates for such formatter functions are all those used in binding expressions which are evaluated during XML template processing, including those used inside template instructions like <code>&lt;template:if></code>. The formatter function needs to be marked with a property <code>requiresIContext = true</code> to express that it requires this extended signature (compared to ordinary formatter functions). The usual arguments are provided after the first one (currently: the raw value from the model).

This interface provides callback functions to access the model and path which are needed to process OData V4 annotations. It initially offers a subset of methods from {@link sap.ui.model.Context} so that formatters might also be called with a context object for convenience, e.g. outside of XML template processing (see below for an exception to this rule).

<b>Example:</b> Suppose you have a formatter function called "foo" like below and it is used within an XML template like <code>&lt;template:if test="{path: '...', formatter: 'foo'}"></code>. In this case <code>foo</code> is called with arguments <code>oInterface, vRawValue</code> such that <code>oInterface.getModel().getObject(oInterface.getPath()) === vRawValue</code> holds. <pre>
window.foo = function (oInterface, vRawValue) {
    //TODO ...
};
window.foo.requiresIContext = true;
</pre>

<b>Composite Binding Examples:</b> Suppose you have the same formatter function and it is used in a composite binding like <code>&lt;Text text="{path: 'Label', formatter: 'foo'}: {path: 'Value', formatter: 'foo'}"/></code>. In this case <code>oInterface.getPath()</code> refers to ".../Label" in the 1st call and ".../Value" in the 2nd call. This means each formatter call knows which part of the composite binding it belongs to and behaves just as if it was an ordinary binding.

Suppose your formatter is not used within a part of the composite binding, but at the root of the composite binding in order to aggregate all parts like <code> &lt;Text text="{parts: [{path: 'Label'}, {path: 'Value'}], formatter: 'foo'}"/></code>. In this case <code>oInterface.getPath(0)</code> refers to ".../Label" and <code>oInterface.getPath(1)</code> refers to ".../Value". This means, the root formatter can access the ith part of the composite binding at will (since 1.31.0); see also {@link #.getInterface getInterface}. The function <code>foo</code> is called with arguments such that <code> oInterface.getModel(i).getObject(oInterface.getPath(i)) === arguments[i + 1]</code> holds. This use is not supported within an expression binding, that is, <code>&lt;Text text="{= ${parts: [{path: 'Label'}, {path: 'Value'}], formatter: 'foo'} }"/></code> does not work as expected because the property <code>requiresIContext = true</code> is ignored.

To distinguish those two use cases, just check whether <code>oInterface.getModel() === undefined</code>, in which case the formatter is called on root level of a composite binding. To find out the number of parts, probe for the smallest non-negative integer where <code>oInterface.getModel(i) === undefined</code>. This additional functionality is, of course, not available from {@link sap.ui.model.Context}, i.e. such formatters MUST be called with an instance of this context interface.

sap.ui.core.service.ServiceFactory.!description:
A service factory is used to create service instances for a specific context. The service factory needs to be registered in a central {@link sap.ui.core.service.ServiceFactoryRegistry service factory registry}. Consumers of services require the service factory to create service instances.

The service factory base class can be used in a generic way to act as a factory for any service: <pre>
sap.ui.require([
  "sap/ui/core/service/ServiceFactoryRegistry",
  "sap/ui/core/service/ServiceFactory",
  "my/Service"
], function(ServiceFactoryRegistry, ServiceFactory, MyService) {

  ServiceFactoryRegistry.register(new ServiceFactory(MService));

});
</pre>

Additionally a concrete service factory can be implemented by extending the service factory base class if additional functionality is needed when creating new instances for a specific context: <pre>
sap.ui.define("my/ServiceFactory", [
  "sap/ui/core/service/ServiceFactoryRegistry",
  "sap/ui/core/service/ServiceFactory",
  "my/Service"
], function(ServiceFactoryRegistry, ServiceFactory, MyService) {

  return ServiceFactory.extend("my.ServiceFactory", {
    createInstance: function(oServiceContext) {
      return Promise.resolve(new MyService(oServiceContext));
    }
  });

});
</pre>

Another option for the usage of the service factory is to provide a structured object with information about the service which will create an anonymous service internally: <pre>
sap.ui.define("my/ServiceFactory", [
  "sap/ui/core/service/ServiceFactoryRegistry",
  "sap/ui/core/service/ServiceFactory",
  "my/Service"
], function(ServiceFactoryRegistry, ServiceFactory, MyService) {

  return new ServiceFactory({

    init: function() { ... },
    exit: function() { ... },

    doSomething: function() { ... }

  });

});
</pre>

As <code>createInstance</code> returns a <code>Promise</code> e.g. the service module can also be loaded asynchronously and resolve once the module has been loaded and instantiated.

