override.!description:
Override the ControllerExtension class with the given custom extension definition.

Only public methods that are not final could be overridden. The lifecycle methods <code>onInit</code>, <code>onExit</code>, <code>onBeforeRendering</code> and <code>onAfterRendering</code> are added before or after the lifecycle functions of the original extension.

Example for <code>oExtension</code>: <pre>
{
    onInit: function() {
        ...
    },
    ...
}
</pre>

<b>Note:</b> This static method is automatically propagated to subclasses of <code>ControllerExtension</code>.

parameters.oParameters:
type: object, description: The parameters for the route. As of Version 1.75 the recommendation is naming the query parameter with a leading "?" character, which is identical to the definition in the route's pattern. The old syntax without a leading "?" character is deprecated. e.g. <b>Route:</b> <code>{parameterName1}/:parameterName2:/{?queryParameterName}</code> <b>Parameter:</b> <pre>
				{
					parameterName1: "parameterValue1",
					parameterName2: "parameterValue2",
					"?queryParameterName": {
						queryParameterName1: "queryParameterValue1"
					}
				}
				</pre>

assert.!description:
A map of QUnit-style assertions to be used in an opaTest.

Contains all methods available on <code>QUnit.assert</code> for the running QUnit version. Available assertions are: <code>ok</code>, <code>equal</code>, <code>propEqual</code>, <code>deepEqual</code>, <code>strictEqual</code> and their negative counterparts. You can define custom OPA5 assertions in the extensions section of {@link sap.ui.test.Opa5.extendConfig}.

Example usage: <pre>
  oOpa5.waitFor({
    success: function () {
      Opa5.assert.ok(true, "Should be true");
    }
  });
</pre>

For more information, see {@link sap.ui.test.opaQunit}.

opaQunit.!description:
QUnit test adapter for OPA: add a test to be executed by QUnit Has the same signature as QUnit.test (QUnit version is also considered) Suggested usage: <pre><code>
sap.ui.require(["sap/ui/test/Opa5", "sap/ui/test/opaQunit"], function (Opa5, opaTest) {

   Opa5.extendConfig({
       assertions: new Opa5({
           checkIfSomethingIsOk : function () {
               this.waitFor({
                   success: function () {
                       Opa5.assert.ok(true, "Everything is fine");
                   }
               });
           }
       })
   });

   opaTest("Should test something", function (Given, When, Then) {
      // Implementation of the test
      Then.checkIfSomethingIsOk();
   });

});
</code></pre>

sap.ui.core.support.usage.EventBroadcast.!description:
Broadcasts UI5 events via single native custom browser event. This way consumers have a generic mechanism for hooking into any UI5 event. Example consumer code: <pre>
    window.addEventListener("UI5Event", function(oEvent) {

    		// consumer coding, e.g. :
    		// analyze event
    		// store events - GDPR is responsibility of the consumer
    		// or any other

    		var oDetail = oEvent.detail;

    		console.log("UI5 Event " 				+ oDetail.eventName
    			+ " occurred at " 					+ new Date(oDetail.timestamp).toString()
    			+ " for element " 					+ oDetail.targetId
    			+ " of type "						+ oDetail.targetType
    			+ ", which is part of component " 	+ oDetail.componentId
    			+ " with version " 					+ oDetail.componentVersion
    			+ " and additional parameters "		, oDetail.additionalAttributes);

    });
</pre>

